import './App.css';
import HomePage from './pages/HomePage';
import { BrowserRouter as Router, Route} from "react-router-dom";
import Navbar from './components/Header';

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar />

          <Route exact path="/" component={HomePage} />

      </Router>

    </div>
  );
}

export default App;
